import React, { useState } from "react";
/* components */
import Container from "../components/Container";
import MainHeder from "../components/MainHeder";
import Button from "../components/Button";
/* style */
import "../views/LoginAndSignUp.module.scss";

export default function LoginAndSignUp() {
    const [registration, setRegistration] = useState("");
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [numberId, setNumberId] = useState("");
    const [phoneNumber, setPhoneNumber] = useState("");
    const [city, setCity] = useState("");
    const [street, setStreet] = useState("");
    const [number, setNumber] = useState("");
    const [zipCode, setZipCode] = useState("");
    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("");


    if (registration === "openRegistration") {
        return (
            <Container secundContainer={true}>
                <MainHeder>Rejestracja</MainHeder>
                <form>
                    <label>
                        <span>Dane personalne</span>
                        <div>
                            <input
                                value={firstName}
                                onChange={(e) => setFirstName(e.target.value)}
                                placeholder="Wpisz swoje imię" />
                            <input
                                value={lastName}
                                onChange={(e) => setLastName(e.target.value)}
                                placeholder="Wpisz swoje nazwisko" />
                            <input
                                value={numberId}
                                onChange={(e) => setNumberId(e.target.value)}
                                placeholder="Pesel" />
                            <input
                                value={phoneNumber}
                                onChange={(e) => setPhoneNumber(e.target.value)}
                                placeholder="Numer kontaktowy" />
                        </div>
                    </label>
                    <label>
                        <span>Adres</span>
                        <div>
                            <input
                                value={city}
                                onChange={(e) => setCity(e.target.value)}
                                placeholder="miasto" />
                            <input
                                value={street}
                                onChange={(e) => setStreet(e.target.value)}
                                placeholder="ulica" />
                            <input
                                value={number}
                                onChange={(e) => setNumber(e.target.value)}
                                placeholder="numer domu" />
                            <input
                                value={zipCode}
                                onChange={(e) => setZipCode(e.target.value)}
                                placeholder="kod pocztowy" />
                        </div>

                    </label>

                    <label>
                        <span>Dane konta</span>
                        <div>
                            <input
                                onChange={(e) => setEmail(e.target.value)}
                                value={email}
                                placeholder="emial" />
                            <input
                                onChange={(e) => setPassword(e.target.value)}
                                value={password}
                                placeholder="hasło" />
                            <input placeholder="powtórz hasło" />
                        </div>

                    </label>
                    <div>
                        <Button>Zarejestruj</Button>
                        <Button onClick={() => setRegistration("")}>Powrót do logowania</Button>
                    </div>

                </form>
            </Container>
        )
    }
    return (
        <Container secundContainer={true}>
            <MainHeder>Logowanie</MainHeder>
            <form>
                <input placeholder="Login" />
                <input placeholder="Podaj hasło" />
                <Button>Zaloguj</Button>
            </form>
            <p>Aby stworzyć konto kliknij <Button secundBtn={true} onClick={() => setRegistration("openRegistration")}>tutaj</Button></p>
        </Container>
    )
}
